  true,\n\t\"url\": null,\n\t\"notes\": \"This memorandum explains the FNS policy
  that extends the flexibility regarding Meat/Meat Alternate (M/MA) maximums for the
  school year 2013-2014.  This memo allows State agencies to assess compliance based
  on the minimum daily and weekly serving requirements only, therefore, they are able
  to exceed the limit on the number of ounces of M/MA that can be served in any given
  week as long as they are compliant with the calorie requirements of the new meal
  pattern.\",\n\t\"owner_org\": \"4ae51f6c-467a-4f9d-b40a-2c52e83c326a\",\n\t\"extras\":
